import time
start_time = time.time()

def maxProdInTable(table):
    print("--- Beginning %s seconds ---" % (time.time() - start_time))
    size = len(table)
    right_side = size - 1
    max_product = 0
    skip = []
    done = []

    if size % 2 == 0:
        start_cell = size - 1
    else:
        start_cell = size

    print("--- Starting skip %s seconds ---" % (time.time() - start_time))
    max_product, skip = getIndividualMax(table, 0, right_side)


    print("--- starting loops %s seconds ---" % (time.time() - start_time))
    for cell in range(start_cell, 1, -2):
        left_offset = cell/2
        right_offset = right_side - left_offset + 1

        if max_product >= (cell+cell-1) ** 3:
            break

        print("--- Inside loops %s seconds ---" % (time.time() - start_time))
        for n in range(left_offset, right_offset):
            for m in range(left_offset, right_offset):
                if [n, m] in skip:
                    continue

                if [n, m] in done:
                    continue

                done.append([n, m])

                for cross_iter in range(left_offset, 0, -1):
                    cross_result = getCrossProduct(table, n, m, cross_iter, skip)

                    if cross_result:
                        if cross_result > max_product:
                            max_product = cross_result
                            break

                for diag_iter in range(left_offset, 0, -1):
                    diagonal_result = getDiagonalProduct(table, n, m, diag_iter, skip)

                    if diagonal_result:
                        if diagonal_result > max_product:
                            max_product = diagonal_result
                            break

    print("--- All done %s seconds ---" % (time.time() - start_time))
    return max_product % 1000000007


def getCrossProduct(table, n, m, offset, skip):
    if [n-1, m] in skip:
        return 0
    if [n+1, m] in skip:
        return 0
    if [n, m-1] in skip:
        return 0
    if [n, m+1] in skip:
        return 0

    total_cross = 1

    for x in range(n-offset, n+offset+1):
        check_x = table[x][m]
        if check_x == 0:
            return 0

        total_cross *= check_x

    for y in range(m-offset, m+offset+1):
        check_y = table[n][y]
        if check_y == 0:
            return 0

        total_cross *= check_y

    return total_cross / table[n][m]


def getDiagonalProduct(table, n, m, offset, skip):
    if [n-1, m-1] in skip:
        return 0
    if [n+1, m+1] in skip:
        return 0
    if [n+1, m-1] in skip:
        return 0
    if [n-1, m+1] in skip:
        return 0

    total_diag = 1

    for x in range(-offset, offset+1):
        check_x = table[n+x][m+x]
        if check_x == 0:
            return 0

        total_diag *= check_x

    for y in range(-offset, offset+1):
        check_y = table[n+y][m-y]
        if check_y == 0:
            return 0

        total_diag *= check_y

    return total_diag / table[n][m]


def getIndividualMax(table, start, stop):
    individual_max = 0
    skip = []
    for x in range(start, stop + 1):
        for y in range(start, stop + 1):
            if table[x][y] > individual_max:
                individual_max = table[x][y]
            if table[x][y] == 0:
                skip.append([x, y])

    return individual_max, skip


